script: |
  super -f text -I q11594.spq | sort > q11594.out

inputs:
  - name: q11594.spq
    data: |
      SELECT ALL - + col1 FROM tab1 (FORMAT parquet) WHERE col1 <> NULL OR NOT ( NOT ( ( NOT + col2 * 18 < + col0 * - + col1 + - 0 - - + col1 + + col1 / - col2 ) ) );
  - name: tab1

outputs:
  - name: q11594.out
    data: |
      -14
      -47
      -5
